Ext.data.JsonP['Alloy_1.7.35_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Alloy 1.7.35 - 10 March 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-46246186\" class=\"content\">\n                        <h1>Alloy 1.7.35 - 10 March 2016</h1>\n    <p>Alloy 1.7.35 is a patch release that includes one known issue.    </p>\n    <div class=\"section section-2 \" id=\"src-46246186_Alloy1.7.35ReleaseNote-KnownIssue\">\n        <h2 class=\"heading \"><span>Known Issue</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-20537\" target=\"_blank\">TIMOB-20537</a> - Alloy-themed i18n and platform folders no longer work since Ti 5.2.0.GA    </p>\n<ul class=\" \"><li class=\" \">    <p>Due to a change in Titanium i18n and platform folders in Alloy themes and widgets no longer get merged into the project i18n and platform folders    </p>\n</li></ul></li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46246186\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Alloy 1.7.35 Release Note"});